  false,\n\t\"url\": null,\n\t\"notes\": \"While on a research and monitoring cruise
  that visited Johnston Atoll in late January 2010, USFWS employees found an infestation
  of Anoplolepis gracilipes, or yellow crazy ants (YCA) affecting approximately 40
  of 260-hectare Johnston Island. The YCA is a successful u201ctrampu201d species
  which has spread through Oceania and the Tropics hitchhiking on human transport.
  They form large, multi-queen u201csuper coloniesu201d that disperse mainly by budding.
  The rate of expansion for new colonies is startlingly fast, with infestation growing
  as rapidly as 0.1- 3.0 meters per day. This project continued eradication efforts
  of the YCA from Johnston Island, Johnston Atoll NWR.\",\n\t\"license_title\": \"License
